(def mms-load-canonical-record
  (into {} (for [[k v] (group-by :q_norm (filter f-all d))] 
                 [k {:ns (count (distinct (map #(:ns %) v)))
                   :count (count v)
                   :sample (distinct (map #(:q_string %) v))}]
               )))

