;; **
;;; # Analyzing Utils
;; **

;; @@
;; 
(defn get-unique-ts-in-second [d f]
  (frequencies (map #(:epoch %) (filter f d))))

(defn get-unique-op [d]
  (frequencies (map #(:op %) d)))

(defn get-unique-ns [d]
  (frequencies (map #(:ns %) (filter not-nil? d))))

(defn get-unique-db [d]
  (frequencies (map #(get-db-name (:ns %)) (filter not-nil? d))))

(defn get-unique-cmd [d]
  (frequencies (map #(:cmd %) (filter not-nil? d))))


;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;mongo-analyzer.log-analyzer/get-unique-cmd</span>","value":"#'mongo-analyzer.log-analyzer/get-unique-cmd"}
;; <=

;; @@
(defn op-read
  [l]
  (case (:op l)
    "command" (:cmd l)
    "update" (str "update" (match [(:update l)]
                                  [{:OP_inc _}]  "-$inc"
                                  [{:OP_set _}]  "-$set"
                                  [{:OP_pull _}] "-$pull"
                                  :else "update"
                             ))
    (:op l))) ;; end of op-read

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;mongo-analyzer.log-analyzer/op-read</span>","value":"#'mongo-analyzer.log-analyzer/op-read"}
;; <=

;; @@

(defn analyze-ns-load [nsp d]
  (frequencies (map #(op-read %) (filter #(= (:ns %) nsp) d)))
  )

(defn get-unique-ns-load [d]
  (sort (into #{} (map (fn [e] [(key e) (analyze-ns-load (key e) d)] ) (get-unique-ns d)))))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;mongo-analyzer.log-analyzer/get-unique-ns-load</span>","value":"#'mongo-analyzer.log-analyzer/get-unique-ns-load"}
;; <=

;; @@

(defn draw-chart [d c]
  (let [
      num-draw c
      f1 (list-plot (take c (vals (sort (get-unique-ts-in-second d f-all)))) :symbol-size 20)
      f2 (list-plot (take c (vals (sort (get-unique-ts-in-second d f-update-only)))) :symbol-size 20)
      f3 (list-plot (take c (vals (sort (get-unique-ts-in-second d f-cmd-only)))) :symbol-size 20)
      f4 (list-plot (take c (vals (sort (get-unique-ts-in-second d f-query-only)))) :symbol-size 20)
      f5 (list-plot (take c (vals (sort (get-unique-ts-in-second d f-insert-only)))) :symbol-size 20)
      f6 (list-plot (take c (vals (sort (get-unique-ts-in-second d f-getmore-only)))) :symbol-size 20)
        ]
  
  

  (table-view {:f-all          f1
               :f-update-only  f2
               :f-cmd-only     f3
               :f-query-only   f4
               :f-insert-only  f5
               :f-getmore-only f6}
               :columns ['filter 'chart]
               )
  
    ))
